
CREATE DATABASE IF NOT EXISTS `desktop_research` /*!40100 DEFAULT CHARACTER SET utf8mb4 COLLATE utf8mb4_bin */ /*!80016 DEFAULT ENCRYPTION='N' */;
USE `desktop_research`;

CREATE TABLE IF NOT EXISTS `repository_language` (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `language` varchar(10) COLLATE utf8mb4_bin NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `language_UNIQUE` (`language`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin;



CREATE TABLE IF NOT EXISTS `repository_dependency` (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `dependency` varchar(20) COLLATE utf8mb4_bin NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `dependency_UNIQUE` (`dependency`)
) ENGINE=InnoDB AUTO_INCREMENT=34 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin;


-- Copiando estrutura para tabela desktop_research.repository
CREATE TABLE IF NOT EXISTS `repository` (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `name_with_owner` varchar(120) COLLATE utf8mb4_bin NOT NULL,
  `stars` mediumint unsigned NOT NULL COMMENT 'for popularity',
  `created_at` date NOT NULL COMMENT 'for P2M1',
  `number_of_tags` tinyint NOT NULL DEFAULT '0' COMMENT 'for P1M1',
  `full_description` text COLLATE utf8mb4_bin COMMENT 'for natural language processing and P1M1',
  `repository_language_id` int unsigned NOT NULL,
  `repository_dependency_id` int unsigned NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `nameWithOwner_UNIQUE` (`name_with_owner`),
  KEY `fk_repository_repository_language_idx` (`repository_language_id`),
  KEY `fk_repository_repository_dependency1_idx` (`repository_dependency_id`),
  CONSTRAINT `fk_repository_repository_dependency1` FOREIGN KEY (`repository_dependency_id`) REFERENCES `repository_dependency` (`id`),
  CONSTRAINT `fk_repository_repository_language` FOREIGN KEY (`repository_language_id`) REFERENCES `repository_language` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1782 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin;






-- Tags
CREATE TABLE IF NOT EXISTS `repository_tag` (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `tag` varchar(30) COLLATE utf8mb4_bin NOT NULL COMMENT 'for P1M1',
  `repository_id` int unsigned NOT NULL,
  PRIMARY KEY (`id`),
  KEY `fk_repository_tag_repository1_idx` (`repository_id`),
  CONSTRAINT `fk_repository_tag_repository1` FOREIGN KEY (`repository_id`) REFERENCES `repository` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=5151 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin;



CREATE TABLE IF NOT EXISTS `repository_category_openia` (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `category` varchar(50) COLLATE utf8mb4_bin DEFAULT NULL,
  `repository_id` int unsigned NOT NULL,
  PRIMARY KEY (`id`),
  KEY `fk_repository_category_openia_repository1_idx` (`repository_id`),
  CONSTRAINT `fk_repository_category_openia_repository1` FOREIGN KEY (`repository_id`) REFERENCES `repository` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=6970 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin;


CREATE TABLE IF NOT EXISTS `repository_complete_category_openia` (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `category` varchar(150) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL,
  `repository_id` int unsigned NOT NULL,
  PRIMARY KEY (`id`),
  KEY `fk_repository_complete_category_openia_repository1_idx` (`repository_id`),
  CONSTRAINT `fk_repository_complete_category_openia_repository1` FOREIGN KEY (`repository_id`) REFERENCES `repository` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=5751 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin;





