CREATE TABLE IF NOT EXISTS `repository_issue` (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `year` year NOT NULL COMMENT 'for P3M2',
  `open` mediumint unsigned NOT NULL COMMENT 'for P3M2',
  `closed` mediumint unsigned NOT NULL COMMENT 'for P3M2',
  `repository_id` int unsigned NOT NULL,
  PRIMARY KEY (`id`),
  KEY `fk_repository_issue_repository1_idx` (`repository_id`),
  CONSTRAINT `fk_repository_issue_repository1` FOREIGN KEY (`repository_id`) REFERENCES `repository` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin;


CREATE TABLE IF NOT EXISTS `repository_pull_request` (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `year` year NOT NULL COMMENT 'P3M1',
  `open` mediumint unsigned NOT NULL COMMENT 'P3M1',
  `merged` mediumint unsigned NOT NULL COMMENT 'P3M1',
  `canceled` mediumint unsigned NOT NULL COMMENT 'P3M1',
  `repository_id` int unsigned NOT NULL,
  PRIMARY KEY (`id`),
  KEY `fk_repository_pull_request_copy1_repository1_idx` (`repository_id`),
  CONSTRAINT `fk_repository_pull_request_copy1_repository1` FOREIGN KEY (`repository_id`) REFERENCES `repository` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin;

